39; is correct\",\"answerIsWrong\":\"&#039;:ans&#039; is wrong\",\"answeredCorrectly\":\"Answered correctly\",\"answeredIncorrectly\":\"Answered incorrectly\",\"solutionLabel\":\"Correct answer:\",\"inputLabel\":\"Blank input @num of @total\",\"inputHasTipLabel\":\"Tip available\",\"tipLabel\":\"Tip\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"autoCheck\":false,\"caseSensitive\":true,\"showSolutionsRequiresInput\":true,\"separateLines\":false,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"enableCheckButton\":true,\"acceptSpellingErrors\":false},\"confirmCheck\":{\"header\":\"Finish ?\",\"body\":\"Are you sure you wish to finish ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Finish\"},\"confirmRetry\":{\"header\":\"Retry ?\",\"body\":\"Are you sure you wish to retry ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Confirm\"},\"questions\":[\"<p>The food diet of the <strong>hedghog</strong> is mainly made of *insects/worms*, slugs, snails and *worms/insects*. But 15% of its diet is made of *seeds* and fruits. The food diet of the hedgehog tells us that it is an *omnivore*.</p>\\n\\n<p>We find only plant matters in the food diet of *deer/deers*. Hence, they are *herbivores*. They eat *grass/leaves*, *leaves/grass* and brambles.&nbsp;</p>\\n\\n<p>The favorite food of <strong>snakes</strong> are *small rodents/rodents*, followed by insects. Snakes eat other animals. Hence, they are *carnivores*.&nbsp;</p>\\n\"],\"overallFeedback\":[{\"from\":0,\"to\":100,\"feedback\":\"You got @score of @total points\"}],\"scoreBarLabel\":\"You got :num out of :total points\",\"submitAnswer\":\"Submit\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"a11yCheckingModeHeader\":\"Checking mode\"},\"library\":\"H5P.
